import React from "react";
import "./App.css";
import "./MovieCard.css";


function MovieCard({movie}) {
    return (
      <div className="movie-card">
      <div className="movie-card card">
          <img className="card-img-top" src={movie.imageUrl} alt="" />
          <div className="card-body">
              <h4 className="card-title">{movie.title}</h4>
              <h6 className="card-subtitle mb-2 text-muted">{movie.duration}</h6>
              <p className="text-justify" style={{fontSize: '14px'}}>{movie.genre}</p>
          </div>
          <div className="card-footer">
              <div className="clearfix">
                  <div className="float-left mt-1">
                      <StarRating rating={movie.score} />
                  </div>
                  <div className="card-footer-badge float-right badge badge-primary badge-pill">{props.movie.rating}</div>
              </div>
          </div>
      </div>
  </div>
);
  }

export default MovieCard;
